public class Expression {
  private int precedence = 0;

  public Expression(int num) {
    precedence = num; 
  }

  public double evaluate() {
    return Double.NaN;
  } 

  public int getPrecedence(){
    return precedence; 
  }
  public boolean higherPrecedanceThan(Expression otherExp){
    return this.precedence > otherExp.getPrecedence();
  }
}





public class Number extends Expression {

  private double value = 0;

  public Number(double val) {
    value = val;
    super.Expression(1);
  }

  public double evaluate() {
    return this.value;
  }
  public String toString(){
    return value.toString();
  }
}





public class BinaryOperator extends Expression {

  private String operator = "";

  public BinaryOperator(int precedence, String op) {
    firstExp = new Expression();
    secondExp = new Expression();
    super.Expression(precedence);
    operator = op;
  }

  public getLeft() {
    return firstExp;
  }

  public getRight() {
    return secondExp;
  }
  public String toString(){
    return firstExp.toString() + " " + operator + " " + secondExp.toString(); //not going to try for the wrapping right now
  }
}
